import React from "react";

const distanceToNest = (droneData, drone) => {
    return Math.sqrt(Math.pow(250000-droneData[drone].children['8'].value, 2)+Math.pow(250000-droneData[drone].children['7'].value, 2))
};

const FilterInsideNDZ = (droneData) => {
    const result = Object.keys(droneData).filter(drone => distanceToNest(droneData, drone) < 100000)
    console.log(result)
};

export default FilterInsideNDZ
